import React from 'react';
import './Dividers.css';
import Divider from '../Divider/Divider';

const Dividers = (props) => {
  return (
    <div className="dividers">
      {props.albhabet.map(function (value, index) {
          return <Divider key={index} item={value} onItemClick={props.onItemClick} onDeleteItem={props.onDeleteItem} ></Divider>
      })}
    </div>
  );
}

export default Dividers;
